insert  into `t_word`(`WORD_NO`,`WORD_NM`,`CONT`,`OPEN_YN`,`REGISTER`,`REG_DT`) values 
(2,'제품디자인분야(제주도내 4개 회사)','1. 생활용품, 레포츠, 취미 및 의료기기 디자인\r\n2. 전기, 전자, 정보 통신기기 디자인\r\n3. 사무기기 및 문구, 아동용구 및 교육용품 디자인 등','Y','123-11-7897','2022-05-31'),
(1,'시각디자인분야(제주도내93개 회사)','1. 아이덴티티디자인 _ C.I, BI, 도시아이덴티티등\r\n2. 포스터, 광고디자인\r\n3. 프로모션 디자인\r\n4. 북, 편집디자인\r\n5. 일러스트레이션, 캐릭터디자인  등','Y','dlink','2022-05-31'),
(3,'멀티미디어디자인분야(제주도내 15개 회사)','1. 웹사이트, 키오스크 등 인터랙티브 디자인\r\n2. 광고, 홍보 등 영상 디자인\r\n3. 애니메이션\r\n4. 건물 외변 LED 등 미디어파사드디자인','Y','dlink','2022-05-31'),
(4,'포장디자인분야(제주도내 13개 회사)','1. 박스 및 표면디자인\r\n2. 라벨디자인\r\n3. 용기디자인\r\n4. POP디자인 등','Y','dlink','2022-05-31'),
(5,'환경디자인분야(제주도내 68개 회사)','1. 환경, 공공디자인\r\n2. 건축, 조경, 디스플레이\r\n3. 공공 옥외시설물\r\n4. 환경색채 및 조형물\r\n5. 실내 공간디자인 등','Y','dlink','2022-05-31'),
(6,'서비스디자인분야','1. 공공서비스 디자인_공공서비스, 고령화, 안전 등 사회문제를 위한 디자인\r\n2. 제조, 서비스 융합 서비스 디자인_제조에 서비스를 접목하여 고부가가치화\r\n3. 서비스 산업을 위한 서비스 디자인 등','Y','dlink','2022-05-31'),
(7,'기타디자인분야','1. 디자인 이론 / 연구개발\r\n2. 디자인 경영_경영, 마케팅 및 유통, 평가, 컨설팅 등\r\n3. 기술융합디자인_IOT, VR, AR, 빅데이터 등','Y','dlink','2022-05-31');
